$(document).ready(function() {

		    $('table').DataTable( {
		        "order": [[ 0, "desc" ]],
		        language: {
			        search: "_INPUT_",
			        searchPlaceholder: "Search..."
			    },
			    "lengthChange": false,
			    "sDom": '<"row view-filter"<"col-sm-12"<"pull-left"lp><"pull-right"f><"clearfix">>>t<"row view-pager"<"col-sm-12"i>>'
		    } );

		    var l = Ladda.create( document.querySelector( '#btn_confirm' ) );

		    $('#btn_confirm').on('click', function() {
		    	
		    	l.start();

		    	var sUrl = 'index.php?';

		    	for (var prop in Url.get) {
		    		if (prop != 'confirm') {
		    			sUrl += '&' + prop + '=' + Url.get[prop];
		    		}
				}

		    	$.ajax({
					url: sUrl,
						data: {
						format: 'json'
					},
					type: 'GET',
					success: function(data) {

						data = JSON.parse(data);
						
						if (data.success == true) {

							var changedArticles = data.changed_articles[data.request_tokens[0]];

							if (changedArticles == 1) {
								$('#modal1 .modal-content .changed_articles').html(changedArticles + ' article changed.');
							}else{
								$('#modal1 .modal-content .changed_articles').html(changedArticles + ' articles changed.');
							}

							
							$('#modal1 .modal-content .errors').html('no errors.');
						}else{

							$('#modal1 .modal-content .errors').html('<p>' + data.validation_errors.join(', ') + '</p><p>' + data.system_errors.join(', ') + '</p>');
							
						}

						l.stop();
						$('#modal1').modal('toggle');
						console.log(data);
					},
					error: function() {

						l.stop();
						console.log('error');
					}
				   
				});

		    });

		    Url = {
			    get get(){
			        var vars= {};
			        if(window.location.search.length!==0)
			            window.location.search.replace(/[?&]+([^=&]+)=([^&]*)/gi, function(m,key,value){
			                key=decodeURIComponent(key);
			                if(typeof vars[key]==="undefined") {vars[key]= decodeURIComponent(value);}
			                else {vars[key]= [].concat(vars[key], decodeURIComponent(value));}
			            });
			        return vars;
			    }
			};
		} );